    .iv-tmpl-june-header {
        position: sticky;
        top: 0;
        z-index: 3;
        display: block;
        padding: 0 12px;
        box-shadow: 0 1px 0 hsla(0, 0%, 100%, .2);
        margin: 0
    }

    @media (min-width:888px) {
        .iv-tmpl-june-header {
            padding: 0 24px
        }
    }

    @media (min-width:1464px) {
        .iv-tmpl-june-header {
            padding: 0 48px
        }
    }

    .iv-tmpl-june-header:before {
        content: "";
        position: absolute;
        top: 0;
        left: 0;
        z-index: -1;
        display: block;
        width: 100%;
        height: 100%;
        background-color: #1d99cf;
        opacity: 1;
        transition: opacity .24s ease-in-out;
        -webkit-user-select: none;
        -moz-user-select: none;
        user-select: none;
        pointer-events: none
    }

    @supports((-webkit-backdrop-filter:(0px)) or (backdrop-filter:(0px))) or (-webkit-backdrop-filter:(0px)) {
        .iv-tmpl-june-header:before {
            -webkit-backdrop-filter: (80px);
            backdrop-filter: blur(80px)
        }
    }
















    .iv-tmpl-june-header__body {
        position: static;
        display: flex;
        max-width: 1728px;
        background-color: #1d99cf;
        flex-flow: row nowrap;
        justify-content: flex-start;
        align-content: center;
        align-items: center;
        height: 56px;
        padding: 0;
        margin: 0 auto

            margin-right: 16px;
            margin-left: -24px
        }
    }

    @media (min-width:1176px) {

        }
    }

    @media (min-width:1896px) {
        .iv-tmpl-june-header__nav-button {
            left: 0;
            margin-left: 0
        }
    }

    .iv-tmpl-june-header__logo {
        position: relative;
        display: block;
        height: 20px;
        margin: 0 auto 0 0;
        color: #fff;
        text-decoration: none;
        opacity: .96;
        transition: opacity .24s ease
    }

    @media (min-width:888px) {

        }

    .iv-tmpl-june-header__user-menu {
        position: relative;
        display: block;
        padding: 0;
        margin: 0
    }

    .iv-tmpl-june-header__nav-menu {
        box-sizing: border-box;
        position: fixed;
        top: 0;
        left: 0;
        z-index: -2;
        display: block;
        width: 100%;
        height: 100%;
        padding: 0;
        margin: 0;
        opacity: 0;
        visibility: hidden;
        transition: opacity .24s ease-in-out, visibility .24s ease-in-out;
        -webkit-user-select: none;
        -moz-user-select: none;
        user-select: none;
        overflow-y: auto;
        overflow-x: hidden;
        scrollbar-width: none;
        -ms-overflow-style: none
    }

    .iv-tmpl-june-header__nav-menu::-webkit-scrollbar {
        display: none
    }

    @media (min-width:888px) {
        .iv-tmpl-june-header__nav-menu {
            padding-top: 0
        }
    }

    .iv-tmpl-june-header__nav-menu:before {
        content: "";
        position: absolute;
        top: 0;
        right: 0;
        bottom: 0;
        left: 0;
        z-index: -1;
        display: block;
        background-color: rgba(31, 45, 61, .3);
        -webkit-backdrop-filter: blur(40px);
        backdrop-filter: blur(40px);
        pointer-events: none
    }

    .iv-tmpl-june-header__nav-menu:after {
        content: "";
        z-index: 2;
        position: absolute;
        left: 50%;
        top: 100%;
        display: block;
        width: 48px;
        height: 4px;
        margin-left: -24px;
        background-color: #fff;
        border-radius: 8px;
        transition: top .24s ease-in-out
    }

    @media (min-width:888px) {
        .iv-tmpl-june-header__nav-menu:after {
            top: 0;
            left: 0;
            height: 64px;
            width: 100%;
            border-radius: 0;
            margin: 0;
            background-color: rgba(31, 45, 61, .8);
            pointer-events: none;
            transform: none;
            transition: none
        }
    }

    .iv-tmpl-june-header__nav-menu__m-show {
        opacity: 1;
        visibility: visible
    }

    .iv-tmpl-june-header__nav-menu__m-show:after {
        top: 88px
    }

    .iv-tmpl-june-footer-nav {

        grid-auto-flow: row
    }

        .iv-tmpl-june-footer-nav {
            grid-template-columns: auto auto auto;
            grid-template-rows: auto auto auto;
            align-content: flex-start;

        }

        .iv-tmpl-june-footer-nav__group:first-child {
            grid-column: 1/2;
            grid-row: 1/3
        }

        .iv-tmpl-june-footer-nav__group:nth-child(2) {
            grid-column: 2/3;
            grid-row: 1/3
        }

        .iv-tmpl-june-footer-nav__group:nth-child(3) {
            grid-column: 3/4;
            grid-row: 1/2
        }

        .iv-tmpl-june-footer-nav__group:nth-child(4) {
            grid-column: 3/4;
            grid-row: 2/3
        }
    }

    @media (min-width:1176px) {
        .iv-tmpl-june-footer-nav {
            flex-wrap: nowrap
        }
    }

    }

        }
